// import React from "react";
// import ICONS from "./icons";

// const Test = () => {
//   const templateString = `add svg ${ICONS.threedots} here does not work. It return [object Object] instead`;
//   return (
//     <div>
//         {templateString}
//         It works if I add {ICONS.threedots} here
//     </div>
//   )
// };
// export default Test;

var STEPS = {
    identity: [
      `After installing 1Password for Safari, it should automatically interate
      with the desktop app and unlock. If you experience 1Password stays at
      loading screen for too long, you can try these steps.`,
      `1. Make sure that you have the latest version of 1Password 8 from here:
      https://1password.com/downloads.`,
      `2. Open the 1Password desktop app > Select the three dots icon ${ICONS.threedots}at the top left > Settings > Browser and check
      if you see this error message.`,
    ],
    Test: [],
    Solution: [],
  };
